import React, { Component } from 'react';
import '../components/navBar.css';
import logo from '../components/images/logo.jpg';
class Navbar extends Component {
    render() { 
        return (
            <div class="nav-bar">
                <div class="logo">
                    
                </div>
                <img src={logo} alt="" />
                <h1>DEV_DEEPAN</h1>
            </div>
        )
    }
}
 
export default Navbar;
